import React from "react";
import { Figure } from "react-bootstrap";
import pin from "../../assets/icons/pin.svg";
import open from "../../assets/icons/openOrange.svg";
import credit from "../../assets/icons/creditCardPayment.svg";
import cash from "../../assets/icons/cash.svg";
import "./styles.scss";

const HomeCard = () => {
  return (
    <div className="container-fluid" className="outline_card">
      <div className="row" className="card">
        <div className="container" className="card_margin">
          <div className="row">
            <div className="col-4">
              <Figure.Image
                className="image figure"
                alt="image"
                src="https://cdn.pixabay.com/photo/2016/12/26/17/28/spaghetti-1932466_960_720.jpg"
              />
            </div>
            <div className="col-8">
              <h1 className="name">Fonda Don Jose</h1>
              <p className="metros">
                a 300 m<img src={pin} className="pin"></img>
              </p>

              <div>
                <img src={open} className="user-photo"></img>
                <div>
                  <img src={credit}></img>
                  <img src={cash} className="user-photo"></img>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default HomeCard;
